import styled from 'styled-components'

const StyledTotal = styled.div`
    padding:20px;
    color: cyan;
    font-size: 1.2rem;

    h2 {
        color: orange;
        margin-bottom: 20px
    }

    p {
        padding-left: 20px;
        font-weight: 700;
    }
`

export default StyledTotal
